import React from 'react';

function Cell(props) {
	return (
		<div class='container'>
			<img src={props.Avatar} alt='Avatar' style='width:100%;' />
			<h4>{props.sender}</h4>
			<p>{props.message}</p>
		</div>
	);
}

export default Cell;
